import React from 'react'
import { Navbar } from '../components/Navbar'
import { Box, Button } from '@mui/material'

export default function sepetim() {
  return (
    <div>
      <Navbar/>
      <Box component="span" sx={{ p: 2, border: '1px' }}>
      <Button>Save</Button>
    </Box>
    </div>
  )
}
